import { Link } from 'react-router-dom';
import './Navbar.scss';
import {Routes} from '../../routes'

function Navbar() {
    const menu=[
        {
            to: Routes.Home.path, 
            name: 'Accueil'
        }, 
        {
            to: Routes.About.path, 
            name: 'A propos'
        }, 
        {
            to: Routes.Skills.path, 
            name: 'Compétences'
        }, 
        {
            to: Routes.Projects.path, 
            name: 'Projets'
        }, 
    ]

  return (
    <nav>
        <ul>{}
            <li>
                <Link to={Routes.Home.path}>Accueil</Link>
            </li>
            <li>
                <Link to={Routes.About.path}>A propos</Link>
            </li>
            <li>
                <Link to={Routes.Skills.path}>Compétences</Link>
            </li>
            <li>
                <Link to={Routes.Projects.path}>Projets</Link>
            </li>
        </ul>
    </nav>
  );
}

export default Navbar;
